/*Table structure for table `account` */

DROP TABLE IF EXISTS `account`;

CREATE TABLE `account` (
  `account_id` bigint(30) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `account_name` varchar(20) NOT NULL COMMENT '账号名字',
  `account_password` varchar(40) DEFAULT 'jxxdzyjsxy' COMMENT '账号密码',
  `account_phone` bigint(15) DEFAULT NULL COMMENT '账号绑定手机',
  `account_email` varchar(50) DEFAULT NULL COMMENT '账号绑定邮箱',
  `account_status` tinyint(1) DEFAULT '1' COMMENT '账号状态，1为正常，0为锁定',
  `account_role_id` int(10) DEFAULT '0' COMMENT '账号的角色',
  `account_member_id` bigint(30) DEFAULT NULL COMMENT '账号对应的协会成员',
  PRIMARY KEY (`account_id`),
  KEY `FK_member_account_id` (`account_role_id`),
  KEY `FK_account_member_id` (`account_member_id`),
  CONSTRAINT `FK_account_member_id` FOREIGN KEY (`account_member_id`) REFERENCES `member` (`member_id`),
  CONSTRAINT `FK_member_account_id` FOREIGN KEY (`account_role_id`) REFERENCES `accountRolesList` (`role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=190 DEFAULT CHARSET=utf8;

