/*Table structure for table `application_message` */

DROP TABLE IF EXISTS `application_message`;

CREATE TABLE `application_message` (
  `application_id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `punch_record_id` bigint(30) NOT NULL COMMENT '考勤记录ID',
  `punch_type_id` int(5) NOT NULL COMMENT '考勤的类型',
  `application_reason` varchar(100) DEFAULT NULL COMMENT '申请修改考勤类型的理由',
  `application_result` int(20) DEFAULT NULL COMMENT '申请修改考勤类型的结果',
  `change_punch_type` int(5) NOT NULL COMMENT '希望更改的考勤类型',
  `apply_for_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '提出申请的时间',
  PRIMARY KEY (`application_id`),
  UNIQUE KEY `FK_applicationmessage_id` (`punch_record_id`),
  UNIQUE KEY `FK_application_message` (`application_result`),
  KEY `FK_applicationmessage_type_id` (`punch_type_id`),
  KEY `FK_applicationmessage_change_type_id` (`change_punch_type`),
  CONSTRAINT `FK_applicationmessage_change_type_id` FOREIGN KEY (`change_punch_type`) REFERENCES `punchtype` (`punch_type_id`),
  CONSTRAINT `FK_applicationmessage_id` FOREIGN KEY (`punch_record_id`) REFERENCES `punch_record` (`punch_record_id`),
  CONSTRAINT `FK_applicationmessage_type_id` FOREIGN KEY (`punch_type_id`) REFERENCES `punchtype` (`punch_type_id`),
  CONSTRAINT `FK_application_message` FOREIGN KEY (`application_result`) REFERENCES `callback_result` (`callback_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

