/*Table structure for table `callback_result` */

DROP TABLE IF EXISTS `callback_result`;

CREATE TABLE `callback_result` (
  `callback_id` int(20) NOT NULL AUTO_INCREMENT COMMENT '结果单id',
  `application_message_id` int(20) NOT NULL COMMENT '对应异议考勤记录id',
  `callback_result` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审批结果',
  `callback_manager_id` bigint(30) NOT NULL COMMENT '审批的管理',
