  `callback_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '审批的时间',
  PRIMARY KEY (`callback_id`),
  UNIQUE KEY `FK_checkbackresult_checkback_id` (`application_message_id`),
  KEY `FK_checkbackresult_member_id` (`callback_manager_id`),
  CONSTRAINT `FK_checkbackresult_checkback_id` FOREIGN KEY (`application_message_id`) REFERENCES `application_message` (`application_id`),
  CONSTRAINT `FK_checkbackresult_member_id` FOREIGN KEY (`callback_manager_id`) REFERENCES `member` (`member_id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8;

