/*Table structure for table `login_history` */

DROP TABLE IF EXISTS `login_history`;

CREATE TABLE `login_history` (
  `login_history_id` bigint(30) NOT NULL AUTO_INCREMENT COMMENT '主键ID，登录的日志ID',
  `history_account_id` bigint(30) NOT NULL COMMENT '登录的账号ID',
  `last_login_ip` varchar(30) DEFAULT NULL COMMENT '登录的ip地址',
  `last_login_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登录的时间',
  `login_browser` varchar(255) DEFAULT NULL COMMENT '登录的浏览器',
  `login_user_agent` varchar(255) DEFAULT NULL COMMENT '登录的userAgent字符串',
  `login_os_version` varchar(255) DEFAULT NULL COMMENT '登录的操作系统版本',
  `login_status` tinyint(1) NOT NULL COMMENT '登录的状态，1为成功，0为失败',
  `login_address` varchar(255) DEFAULT NULL COMMENT '登录的物理地址',
  PRIMARY KEY (`login_history_id`),
  KEY `FK_loginhistory_account_id` (`history_account_id`),
  CONSTRAINT `FK_loginhistory_account_id` FOREIGN KEY (`history_account_id`) REFERENCES `account` (`account_id`)
) ENGINE=InnoDB AUTO_INCREMENT=629 DEFAULT CHARSET=utf8;

