/*Table structure for table `member` */

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `member_id` bigint(30) NOT NULL AUTO_INCREMENT COMMENT '主键ID.成员的编号',
  `member_name` varchar(20) NOT NULL COMMENT '成员的名字',
  `member_class_name` varchar(20) NOT NULL COMMENT '成员的班级名字',
  `member_sex` tinyint(1) DEFAULT '1' COMMENT '成员的性别，1为男，0为女',
  `member_grade_number` int(4) NOT NULL COMMENT '成员的年级',
  `member_status` tinyint(1) DEFAULT '1' COMMENT '成员在协会的状态，1为正常，0为退会',
  `member_department_id` int(5) DEFAULT '0' COMMENT '成员的部门',
  `member_role_id` int(5) DEFAULT '0' COMMENT '成员在协会的角色',
  `member_manager_id` bigint(30) DEFAULT NULL COMMENT '在协会的管理员',
  PRIMARY KEY (`member_id`),
  KEY `FK_member_role_id` (`member_role_id`),
  KEY `FK_member_department_id` (`member_department_id`),
  CONSTRAINT `FK_member_department_id` FOREIGN KEY (`member_department_id`) REFERENCES `department` (`department_id`),
  CONSTRAINT `FK_member_role_id` FOREIGN KEY (`member_role_id`) REFERENCES `member_roles` (`member_role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10416 DEFAULT CHARSET=utf8;

/*Data for the table `member` */

insert  into `member`(`member_id`,`member_name`,`member_class_name`,`member_sex`,`member_grade_number`,`member_status`,`member_department_id`,`member_role_id`,`member_manager_id`) values (10000,'suny','软件三班',1,2015,1,4,3,10003),(10003,'zzzzz','软件一班',1,2015,1,6,7,NULL),(10415,'测试账号','位置班级',1,2016,1,0,0,NULL);

/*Table structure for table `member_roles` */

DROP TABLE IF EXISTS `member_roles`;

CREATE TABLE `member_roles` (
  `member_role_id` int(5) NOT NULL AUTO_INCREMENT COMMENT '主键ID，成员角色的ID编号',
  `member_role_name` varchar(20) NOT NULL COMMENT '协会角色的名字',
  PRIMARY KEY (`member_role_id`)
