/*Table structure for table `operation` */

DROP TABLE IF EXISTS `operation`;

CREATE TABLE `operation` (
  `operation_id` bigint(30) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `operation_message` varchar(50) DEFAULT NULL COMMENT '操作信息',
  `operation_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `operation_member_name` varchar(30) DEFAULT NULL COMMENT '操作者的名字，可选',
  `operation_brower` varchar(255) DEFAULT NULL COMMENT '操作浏览器',
  `operation_os_version` varchar(255) DEFAULT NULL COMMENT '操作系统版本',
  `operation_user_agent` varchar(255) DEFAULT NULL COMMENT '操作userAgent',
  `operation_request_url` varchar(255) DEFAULT NULL COMMENT '请求url',
  `operation_account_id` bigint(30) NOT NULL COMMENT '操作的账号',
  `operation_status` tinyint(1) NOT NULL COMMENT '操作状态',
  `operation_ip` varchar(100) DEFAULT NULL COMMENT '操作的ip地址',
  `operation_address` varchar(255) DEFAULT NULL COMMENT '操作的地理位置',
  PRIMARY KEY (`operation_id`),
  KEY `FK_account_operation_id` (`operation_account_id`),
  CONSTRAINT `FK_account_operation_id` FOREIGN KEY (`operation_account_id`) REFERENCES `account` (`account_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1602 DEFAULT CHARSET=utf8;

